    const params = useParams();
    const navigate = useNavigate();
    function handleClick() {
        navigate("..");
    }
    return (
        <>
            <h1>EventDetailsPage here...</h1>
            <h3>{params.id}</h3>
            <button onClick={handleClick}>Go Back to Events Page</button>
        </>
    )
}
export default EventsDetailsPage;
